@-moz-document domain("roblox.com") {
    @keyframes rainbow {
        0% {
            background-color: #6d6d6d;
            border-color: #6d6d6d;
        }

        14% {
            background-color: #6d6d6d;
            border-color: #6d6d6d;
        }

        28% {
            background-color: #7f7f7f;
            border-color: #7f7f7f;
        }

        42% {
            background-color: #7f7f7f;
            border-color: #7f7f7f;
        }

        56% {
            background-color: #6d6d6d;
            border-color: #6d6d6d;
        }

        80% {
            background-color: #6d6d6d;
            border-color: #6d6d6d;
        }

        94% {
            background-color: #7f7f7f;
            border-color: #7f7f7f;
        }

        100% {
            background-color: #7f7f7f;
            border-color: #7f7f7f;
        }
    }
    .btn-common-play-game-lg {
        animation: rainbow 15s infinite;
    }
}
